<html xmlns="http://www.w3.org/1999/xhtml"
      xmlns:h="http://xmlns.jcp.org/jsf/html">
      
	<!-- jQuery -->
	<h:outputScript library="vendors" name="jquery/dist/jquery.min.js" />
	<!-- Bootstrap -->
	<h:outputScript library="vendors" name="bootstrap/dist/js/bootstrap.min.js" />

	<h:outputScript library="vendors" name="fastclick/lib/fastclick.js" />
	<!-- NProgress -->
	<h:outputScript library="vendors" name="nprogress/nprogress.js" />

	<h:outputScript library="vendors" name="iCheck/icheck.min.js" />
